import React from 'react'
import logo from '../../assets/logo.svg'
import src from '*.bmp'
import './styles.css'


const Home = () => {
    return (
        <div id="page-home">
            <div className="content">
                <head>
                    <img src={logo} alt="E-coleta"/>
                </head>
            </div>
        </div>
    )
}

export default Home;
